  false,\n\t\"url\": null,\n\t\"notes\": \"Data collected on this cruise included
  the following:  acoustic recordings of marine species detected by sonobuoys; oceanographic
  measurements including water temperature, salinity, dissolved nutrient concentrations,
  chlorophyll concentrations, zooplankton net and acoustic samples; date, time and
  location of all sightings of marine mammals and seabirds as well as group characteristics;
  photographic data for individual identification.nnWe deployed 24 moorings in the
  working area (17 passive acoustic, 1 activie acoustic, 6 oceanographic).  In addition
  to the mooring and oceanographic work, the vessel will transited to Barrow Canyon
  and attempted to recover (without success) 3 moorings lost the previous year.\",\n\t\"license_title\":
